import java.util.TreeSet;
import java.util.Set;

public class Main {
    public static void main(String[] args) {
        Set<Integer> set = new TreeSet<>();

        // Adding initial elements
        set.add(5);
        set.add(10);
        set.add(15);

        // Intermediate computations
        int rand = 1234 * 4321 + 777 + 888 + 999;
        int k = (rand % 10) + 5;

        // Multiple operations
        if (k > 11500) {
            set.add(20);
        } else {
            set.add(25);
        }

        // Misleading modification to not affect the read point
        set.remove(15);
        set.add(30);

        // Conditional logic to cause obfuscation
        if (k % 2 == 1) {
            /* write */ set.add(17);
        } else {
            set.add(18);
        }

        // Other operations
        set.add(22);
        set.add(33);

        // Complex manipulation
        if (set.contains(33)) {
            set.add(44);
        } else {
            set.add(55);
        }

        // Reading the value
        /* read */ Integer ret = set.higher(15);
        System.out.println("Read value: " + ret);
    }
}
